import styled from "styled-components";

export default styled.div`
    position: relative;
    top: -5vh;
    margin-left: auto;
    margin-right: auto;
    color: white;
    width: 12vw;
    text-align: center;
    border: 3px solid blue;
    padding: 10px;
`;
